import React from "react";
import './login.css';

class Login extends React.Component {
    constructor(props) {
        super(props)

        this.state = {}
    }

    componentDidMount() {
        document.title = 'Вход';
    }

    render() {
        return (
            <div className='login-background'>
                <div className='login-panel'>
                    <div className='login-panel-strip'>
                        <h6>Вход</h6>
                    </div>
                    <form>
                        <input type='text' />
                        <input type='password' />
                        <button>Войти</button>
                    </form>
                </div>
            </div>
        );
    }
}

export default Login;
